import { useState } from 'react';
import './DadosUsuario.css';
import LogoAtensus from '../../assets/logo atensus.png'
import MedicaCadastro from '../../assets/medicaCadastro.png';
import { useLocation } from 'react-router-dom';
import axios from '../../lib/axios'



const DadosUsuario = ({ route }) => {

  var location = useLocation();


 
  const cpf = location.state.cpf;
  const senha = location.state.senha;

  const [formData, setFormData] = useState({

    Nome: '',
    Idade: '',
    Altura: '',
    Peso: '',
    Endereco: '',
    Sintomas: '',
    CPF: '',
    Senha: ''
  });

  const handleInputChange = () => {
    const { name, value } = event.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
  
    const requestUrl = `https://localhost:7160/api/Pacientes/login/${formData.CPF}/${formData.Senha}`;
  
    axios.get(requestUrl)
      .then(response => {
        const data = response.data;
  
        setFormData({
          ...formData,
          Nome: data.nome,
          Idade: data.idade,
          Altura: data.altura,
          Peso: data.peso,
          Endereco: data.endereco,
          CPF: data.cpf
        });
      })
      .catch(error => {
        console.error(error);
      });
  };
  
   
 
  return (
    
    <div className="Container-Cadastro">
      <header className='Header-Cadastro'>
        <img src={LogoAtensus} className='Logo'></img>
      </header>
      <img src={MedicaCadastro} alt='Médica' className="Imagem_Principal3" />
      
      <form  onClick={handleSubmit()}>
        <div className='Input-Cadastro'>
          <label htmlFor="Nome">Nome Completo</label>
          <input
            type="text"
            name="Nome"
           id="Nome"
           value={formData.Nome}
           placeholder="Nome Completo"
           onChange={handleInputChange}
          />
        </div>
        <div className='Input-Cadastro'>
          <label htmlFor="Idade">Idade</label>
          <input
            type="text"
            name="Idade"
            id="Idade"
            value={formData.Idade}
            placeholder="Idade"
            onChange={handleInputChange}
          />
        </div>
        <div className='Input-Cadastro'>
          <label htmlFor="Altura">Altura</label>
          <input
            type="text"
            name="Altura"
            id="Altura"
            value={formData.Altura}
            placeholder="Altura"
            onChange={handleInputChange}
          />
        </div>
        <div className='Input-Cadastro'>
          <label htmlFor="Peso">Peso</label>
          <input
            type="text"
            name="Peso"
            id="Peso"
            value={formData.Peso}
            placeholder="Peso"
            onChange={handleInputChange}
          />
        </div>
        <div className='Input-Cadastro'>
          <label htmlFor="Endereco">Endereço Completo</label>
          <input
            type="text"
            name="Endereco"
            id="Endereco"
            value={formData.Endereco}
            placeholder="Endereco"
            onChange={handleInputChange}
          />
        </div>

        <div className='Input-Cadastro'>
          <label htmlFor="Senha">CPF</label>
          <input
            type="text"
            name="Senha"
            id="Senha"
            value={formData.Senha}
            placeholder="Senha"
            onChange={handleInputChange}
          />

        </div>

        <div className='Input-Cadastro'>
          <label htmlFor="CPF">CPF</label>
          <input
             type="text"
             name="CPF"
             id="CPF"
             value={formData.CPF}
             placeholder="CPF"
             onChange={handleInputChange}
          />
        </div>

        
      </form>
      <div className="Bolinha" />
      <div className="Bolinha1" />
      <div className="Bolinha2" />
      <div className="Bolinha3" />
      <div className="Bolinha4" />
    </div>
  );
};

export default DadosUsuario;
